import React from 'react';
import { Card, Card_body, Card_image, Divider_line, Card_button, Module_name} from '../styles/module.style';



function Modules(props){
    return(
        <>
            <Card>
                 <Card_body>
                     <Card_image src={props.img} />
                     <Divider_line></Divider_line>
                     <div>
                         <Module_name><b>{props.name}</b></Module_name>
                     </div>
                     <div>
                         <p>{props.heading}</p>
                     </div>
                     <div>
                         <div><p>Temps pass√© :</p></div>
                         <div>score</div>
                     </div>

                    
                     <center><Card_button>Show Unites</Card_button></center>

                 </Card_body>
            </Card>
        </>
    );
}


export default Modules;
